import React from 'react';
import { NavLink } from 'react-router-dom';
import './assets/css/HomePage.css'; // Add any custom styles for your homepage here

const HomePage = () => {
  return (
    <div className="homepage">
      <h1>Welcome to Book My Party!</h1>
      <div className="nav-links">
        <NavLink to="/Payment" className="nav-link">
          Payment
        </NavLink>
        <NavLink to="/SignupForm" className="nav-link">
          Signup Form
        </NavLink>
        <NavLink to="/CompanyForm" className="nav-link">
          Company Form
        </NavLink>
      </div>
    </div>
  );
};

export default HomePage;
